import React from "react";
import { Button, Stack } from "@mui/material";
import { Link } from "react-router-dom";

export default function DoubleButton(){
    return (
        <Stack 
           direction={{sm:"row", xs:"column" }} 
           spacing={{sm: 8, xs: 2}} 
           alignItems="center"
           justifyContent="center"
           position="relative"
           top={{sm:"480px", xs:"350px"}}
           >
            <Link to="shop">
                <Button variant="contained" color="primary" size="large" sx={{borderRadius: "99px", padding: "5px 60px"}}>
                    Shop
                </Button>
            </Link>
            <Link to="cart">
                <Button variant="contained" color="secondary" href="" size="large" sx={{borderRadius: "99px", padding: "5px 60px"}}>
                    Cart
                </Button>
            </Link>
        </Stack>
    )
}
